/*  REQUIRED LIBRARIES  */
import React from "react";
import { connect } from "react-redux";
import { State } from "./interfaces";
import Peer from "peerjs";

/* SETUP THE MEDIA STREAM */

//Setup the elements
let videoElement: HTMLMediaElement | null = document.querySelector(".remote-video");
let peerIDElement: HTMLInputElement | null = document.querySelector("#connect-to-peer");
let messagesElement = document.querySelector(".messages");

let logMessage = (message: string) => {
    let newMessage = document.createElement("div");
    newMessage.innerText = message;
    messagesElement?.appendChild(newMessage);
};
//This peer id element will be used later

//Set up functions to render the video stream
let renderVideo = (stream: any) => {
    videoElement ? (videoElement.srcObject = stream) : console.log("no video element to render");
};

/*  PEERJS SETUP  */
//Peer ID's
var myID: string;
var id:string;
var IDList:string[];
var docID:string;

var peer = new Peer({ host: "192.168.0.25", port: 9000, path: "/telecon" }); //Port 9000 is the peerJS server port

/*  PEERJS FUNCTIONS  */
//On peer connections
peer.on("open", function (id) {
    console.log("My peer ID is: " + id);
    myID = id;
});
//Check if there is a open peer
peer.on("error", (error) => {
    console.error(error);
});

// Handle incoming data connection
peer.on("connection", (conn) => {
    console.log("incoming peer connection!");
    conn.on("data", (data) => {
        console.log(`received: ${data}`);
    });
    conn.on("open", () => {
        conn.send("hello!");
    });
});
// Handle incoming voice/video connection
peer.on("call", (call) => {
    navigator.mediaDevices
        .getUserMedia({ video: true, audio: true })
        .then((stream) => {
            call.answer(stream); // Answer the call with an A/V stream.
            call.on("stream", renderVideo);
        })
        .catch((err) => {
            console.error("Failed to get local stream", err);
        });
});
// Initiate outgoing connection
export const connectToPeer = () => {
    peer.listAllPeers((peerIDs) => {
        IDList=peerIDs;
        console.log(IDList);
        let i:number;
        for( i = 0; i < IDList.length; i++){
            id=IDList[i];
            console.log(id)
            if(id!==myID)

            docID=id;
                console.log(docID)
        }
    });

    logMessage(`Connecting to ${docID}...`);

    let conn = peer.connect(docID);
    conn.on("data", (data) => {
        logMessage(`received: ${data}`);
    });
    conn.on("open", () => {
        conn.send("hi!");
    });

    navigator.mediaDevices
        .getUserMedia({ video: true, audio: true })
        .then((stream) => {
            let call = peer.call(docID, stream);
            call.on("stream", renderVideo);
        })
        .catch((err: string) => {
            logMessage("Failed to get local stream" + err);
        });
};

document.getElementById("connect_button")?.addEventListener("click", connectToPeer, false);

/*  REACT-REDUX CONNECTION FUNCTIONS  */
const mapStateToProps = (state: State) => ({
    sensors: state.sensors,
});

const dispatchProps = {
    addGamepad: () => {
        type: "AddGamePad";
    },
};

/*  REACT FUNCTIONS FOR APP  */
//Function to connect our react components to our store
const connector = connect(mapStateToProps, dispatchProps);

//Function to return html code based on the state of the store relating to the sensors
const Sensors = (state: State) => (
    <React.Fragment>
        <div>Stethoscope: </div>
        <div>Pulse Oximeter: </div>
        <div>Temperature: </div>
    </React.Fragment>
);

//Export new functions that connect our html returning functions to our store
export const SensorsConnected = connector(Sensors);
